import React, { Component } from 'react'
import {Link} from 'react-router-dom';
export default class Nav extends Component {
    render() {
        return (
            <nav>
                <ul>
                    <Link to="/home">
                        <li>
                            Home
                        </li>
                    </Link>
                    <Link to="/user">
                        <li>
                            Login
                        </li>
                    </Link>       
                 </ul>
            </nav>
        )
    }
}
